import React from "react";
import gsap from "gsap";

const Input = (props) => {
  const click = () => {
    console.log("clicked");
  };
  return (
    <form>
      <input
        onChange={props.handle}
        type="text"
        name="movie"
        placeholder="Search for a Movie..."
      />
      <button
        className="search"
        type="submit"
        onClick={click}
        onClick={props.search}
      >
        Search
      </button>
    </form>
  );
};

export default Input;
